import { useUser } from "../lib/hooks";
import Layout from "./layout";

const PremiumContent = ({ Elements, CheckoutForm, promise }) => {
  const user = useUser();
  // Check whether or not it's a logged in user and that they

  return (
    <Layout>
      {user ? (
        <div>
          Here are all of our PREMIUM content!
        </div>
      ) : (
        <div>
          To access PREMIUM content, purchase a Lifetime Access Pass for $500 below.
          <Elements stripe={promise}>
            <CheckoutForm />
          </Elements>
          </div>
      )}
      <style>{`
        div {
          font-size: 17px;
        }
      `}</style>
    </Layout>
  );
};

export default PremiumContent;
